create table equip_details
(
    id            int auto_increment
        primary key,
    item_id       int               null,
    equip_type    tinyint           null,
    equip_class   tinyint           null,
    equip_quality tinyint           null,
    row_bonus     tinyint default 0 null,
    column_bonus  tinyint default 0 null,
    penalty       int     default 0 null
);

